Thirty48 Running Socks Unisex, CoolMax Fabric Keeps Feet Cool & DryThirty48 - Science + Technology

There are 30.48 centimeters in one foot, and for every foot there is Thirty 48. We are dedicated to creating state-of-the-art, moisture wicking, synthetic blended fabrics that allow your foot to breathe, provide support where needed, and contour to the shape of each specific foot.

The Perfect Collection

We offer different types of Running Socks depending on your needs. For runners who want the extra padding and thicker fabric, we have RU Running Socks. If you want less padding and thinner fabric, we have RUL Light Running Socks. Both series have COOLMAX Fabric which is designed to move moisture away from the foot to you ensure you feel cool and dry. Specialized Athletic PerformanceRun Far and Wide
Extra Padding On The Metatarsal, Achilles, and Heel Provide Abrasion Protection, Prevent Bruising and Pain from Running. The perfect complement to Medical Legwear such as Night Splints, Compression Socks/Sleeves, or Ice Packs for Extensor Tendonitis

Color Your Fitness

Low Cut Style Fits Comfortable With Any Running Shoes, Tennis Shoes, or other Sports Shoes; Our Color Variety Ensures You'll Find the Perfect Pair to Match Your Running Shorts, Workout Pants, Compression Sleeves, or Other Running Gear
 
Quality at The Core
Through extensive testing and research we have identified the most resilient and ideal fabric combination and blending techniques. These discoveries have allowed us to provide a collection of atheltic socks that feel amazing, cater to professional athletes and stand the test of time.
Moisture Repelling, Extra Comfortable & Flexible SupportMoisture Wicking Technology
Each Thirty48 Running Socks is made with CatalystAF, a patent pending technology which allows increased airflow within the channels of the sock's stitching. In combination with our COOLMAX fabric, be ready for an unparalleled feeling of cool, dry comfort that prevents any stickiness.

Cushioned Support For Prolonged Running

Our Running Series also has a padded instep and extra cushion in the heel for added comfort and abrasion protection. 

Form-Fitting Perfection 

There's even an elastic arch support to further minimize friction and produce a fantastic sense of stability and control in your stride. Grip the trail like never before. 
Resilient, Versatile and SpecializedLongevity Meets Efficiency
 

33% CoolMax, 27% Cotton, 30% Nylon, 8% Polyester, 2% Lycra
Stays tight and bright wash after wash.
Heel Tab For Easy Use.
Tear-protected toe and heel.

Foot Specific Design For The Ultimate Fit
 
Thirty48 Running Socks are designed to fit the contours and features of the left and right leg to strengthen muscle force and movement efficiency. 
