MudGear Performance Apparel for Outdoor WarriorsMudGear 1/4 Crew Trail Running SocksMudGear Trail Running Socks are built for the competitive outdoor athlete.  They excel on the open trail, in endurance and adventure races, obstacle course racing, and in outdoor training.

High quarter ankle built to keep out dirt from the trail
Superior handling of water and mud
Long lasting comfort

Shed Water and Suffer in Comfort: In an obstacle race your feet will be covered with water and mud, especially in barbed wire crawls or river walks. Our trail socks offer superior drainage that will keep you light and moving throughout the race like a champ. With a tight fit on your feet, the socks will also help keep any debris from getting into your shoes and in the way. 

About MudGear

The greatest gift obstacle course racing has given us is the rediscovery of the outdoor playground.  We grew up outside as children.  We played hard, breathed deeply, and weren’t afraid to fall.  As we got older we succumbed to the office, the desk chair, the minivan, the fitness center.  We ran on treadmills and allowed asphalt to cover us up.
But it was in us, deep down inside - a longing to do something real, something gritty - something that would free us from the processed, packaged, placated world we had created.   There was something in us that needed to be unleashed, and when it happened it tasted good.  For many, that taste came at their first obstacle adventure race.
MudGear was started in 2012 to serve the growing needs of Obstacle Course Racers who demanded more from their gear. MudGear products stand out for their solid construction, functional performance and toughness.  We don't care to be among the hundreds of gym brands competing for a spot on the elliptical machine - we only serve the outdoor athlete.  We serve the unleashed.

